In zona residenziale e tranquilla, proponiamo la vendita di un appartamento bilivello a schiera.
Si compone di salone con camino, cucina abitabile e bagno al piano primo;
camera matrimoniale, camera ragazzi, cameretta/studio, bagno e balcone al piano secondo; 
lastrico solare vivibile di proprietà esclusiva dell'immobile.
- TERMOAUTONOMO -

Nel residence Antica Domus di Gallicano nel Lazio che sorge su un colle di tufo a 300 metri sul livello del mare, in una posizione molto pittoresca attraversata dagli archi dell’acquedotto Claudio. 
Proponiamo in vendita in zona residenziale un trilocale indipendente su tre lati costruito nel 2011.
Composto da: 
- soggiorno con angolo cottura;
- camera matrimoniale;
- cameretta;
- bagno con vasca idromassaggio;
- nr. 2 balconi di 10 mq. fronte e retro;
- nr. 1 posto auto scoperto privato;
- soffitti con travi in legno a vista;
- piano 1^ di 1 piano;
- ottime rifiniture
- struttura antisismica.

Completano l’immobile: cancello elettrico, videocitofono, porta blindata, impianto tv/satellitare centralizzato, infissi esterni in doppio vetro/legno, grate in ferro zincato, zanzariere.
